import React, { useEffect, useState } from 'react';
import axios from 'axios';

function SismosTable() {
  const [sismos, setSismos] = useState([]);

  useEffect(() => {
    // Solicitar solo sismos con magnitud >= 5
    axios.get('http://localhost:8080/api/sismos/magnitud/5')
      .then(response => {
        setSismos(response.data);
      })
      .catch(error => {
        console.error('Error fetching data: ', error);
      });
  }, []);

  return (
    <div>
      <h2>Tabla de Sismos</h2>
      <table>
        <thead>
          <tr>
            <th>Fecha</th>
            <th>Hora</th>
            <th>Magnitud</th>
            <th>Latitud</th>
            <th>Longitud</th>
            <th>Profundidad</th>
            <th>Referencia de Localizaci√≥n</th>
          </tr>
        </thead>
        <tbody>
          {sismos.map(sismo => (
            <tr key={sismo.id}>
              <td>{sismo.fecha}</td>
              <td>{sismo.hora}</td>
              <td>{sismo.magnitud}</td>
              <td>{sismo.latitud}</td>
              <td>{sismo.longitud}</td>
              <td>{sismo.profundidad}</td>
              <td>{sismo.referenciaLocalizacion}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default SismosTable;
